-- check for missing libraries
local MissingLibraries

if not LibStub then
	print("Libstub not found, LibQuestInfo not loaded.")
	return;
end

do
	local REQUIRED_LIBS = {
		"CallbackHandler-1.0",
		"LibBabble-3.0",
		"LibBabble-Zone-3.0",
		"LibBabble-LibQuestInfoHeader-3.0",
	}
	local missing

	for idx, lib in ipairs(REQUIRED_LIBS) do
		if not LibStub:GetLibrary(lib, true) then
			missing = true
			print(format("The Library %s could not be found LibQuestInfo not loaded.", lib))
		end
	end
	if missing then
		return
	end
end


local MAJOR_VERSION = "LibQuestInfo"
local MINOR_VERSION = tonumber(("$Revision: 1 $"):match("%d+")) or 0

local lib, oldMinor = LibStub:NewLibrary(MAJOR_VERSION, MINOR_VERSION)
if not lib then return end

lib.party = {}
lib.NumPartyPlayer = 0

local ZoneKeys = LibStub("LibBabble-Zone-3.0"):GetReverseLookupTable()
local ZoneNames = LibStub("LibBabble-Zone-3.0"):GetUnstrictLookupTable()
