-- this is just a throttler for QUEST_LOG_UPDATE
local timeSoFar = 0;
local failload = {};

frame:SetScript("OnUpdate", function(this, timeSinceLast)
	timeSoFar = timeSoFar + timeSinceLast
	local first, found
	if not (timeSoFar > 0.25) then
		return
	end

	local currentid = LibQuestInfoTooltip.currentid

	for i = 1, LibQuestInfoTooltip:NumLines() do
		if not LibQuestInfoTooltip[i] then
			LibQuestInfoTooltip[i] = _G[LibQuestInfoTooltip:GetName() .. "TextLeft" .. i]
		end
	end

	if currentid then
		if not questcache[currentid] then
			questcache[currentid] = {}
		end
		questcache[currentid].title = LibQuestInfoTooltip[1] and LibQuestInfoTooltip[1]:GetText()
		if not questcache[currentid].title then
			failload[currentid] = failload[currentid] and failload[currentid] + 1 or 1;
		end
		if (questcache[currentid].title) ~= nil then
			loadqueue[currentid] = nil
			lib.callbacks:Fire("QuestLoaded", currentid)
		end
	end

	timeSoFar = 0
	local size = 0
	for k in pairs(loadqueue) do
		if failload[currentid] and failload[currentid] > 10 then
			questcache[currentid].title = "Quest doesn't exist (Quest ID: " .. currentid ..")";
			loadqueue[k] = nil;
		else
			size = size + 1
		end
	end

	LibQuestInfoTooltip:ClearLines();
	LibQuestInfoTooltip:SetOwner(WorldFrame, "ANCHOR_NONE");

	if size > 0 then
		for qid in pairs(loadqueue) do
			if not LibQuestInfoTooltip.currentid then
				LibQuestInfoTooltip.currentid = qid
				LibQuestInfoTooltip:SetHyperlink("quest:" .. qid)
				return
			end
			if not first then
				first = qid
			end
			if found then
				LibQuestInfoTooltip.currentid = qid
				LibQuestInfoTooltip:SetHyperlink("quest:" .. qid)
				return
			end

			if qid == LibQuestInfoTooltip.currentid then
				found = true
			end
		end
		LibQuestInfoTooltip.currentid = first
		LibQuestInfoTooltip:SetHyperlink("quest:" .. first)
		return
	else
		this:Hide()
		LibQuestInfoTooltip.currentid = nil
	end
end)

if lib.callbacks then
	lib:UnregisterAll(lib) -- unregisters all callbacks that questinfo is doing on itself (comms stuff, mostly)
	lib:UnhookDialogs()
else
	lib.callbacks = LibStub("CallbackHandler-1.0"):New(lib, nil, nil, "UnregisterAll")
end

do
	local tooltip = lib.tooltip
	local function tooltip_line(link, line)
		if not tooltip then
			tooltip = CreateFrame("GameTooltip", MAJOR_VERSION.."_Tooltip", nil, "GameTooltipTemplate")
			tooltip:SetOwner(UIParent, "ANCHOR_NONE")
			lib.tooltip = tooltip
		end
		tooltip:ClearLines()
		tooltip:SetHyperlink(link)

		if tooltip:NumLines() < line then return false end
		return _G[MAJOR_VERSION.."_TooltipTextLeft"..line]:GetText()
	end
	lib.UID_to_name = setmetatable(lib.UID_to_name or {}, {__index = function(self, key)
		local link = (type(key) == 'string') and key or ('quest:'..key)
		local uid = string.match(link, '%d+')
		local name = tooltip_line(link, 1)
		if name then
			self[uid] = name
			return name
		end
		return false
	end,})
end



