local update_is_running

function lib:QUEST_LOG_UPDATE()
	update_is_running = true

	-- The quest log is scanned:
	local selectionId = GetQuestLogSelection()
	local numEntries, numQuests = GetNumQuestLogEntries()
	local zone

	if numEntries > 0 then
		for id = 1, numEntries do
			SelectQuestLogEntry(id)
			local name, level, tag, group, header, _, _, daily, unique_id = GetQuestLogTitle(id)
			if header then
				zone = lib:GetQuestCategoryKey(name);
			else

				-- update questzone
				lib:UpdateQuestZone(unique_id, zone)

				local q = {}
				q.L = level
				q.H = level
				q.M = level

				if group > 0 then
					q.group = group
				end

				if tag then
					q.tag = tag
					if  tag == GROUP then
						q.T = "G"
					elseif  tag == ELITE  then
							q.T = "E"
					elseif  tag == ITEM_HEROIC then
							q.T = "H"
					elseif  tag == RAID  then
							q.T = "R"
					elseif  tag == PVP  then
							q.T = "P"
					elseif  tag == LFG_TYPE_DUNGEON then
							q.T = "D"
					end
				end
				q.Y = daily and 1 or nil
				q.S = "S" .. MINOR_VERSION

				q.O = GetNumQuestLeaderBoards(id)
				if q.O and q.O > 0 then
					for o = 1, q.O do
						local otype = select(2,GetQuestLogLeaderBoard(o, id))
						q["o" .. o] = strupper(tostring(otype):sub(1,1))
					end
				end

				-- update QuestDB
				lib:UpdateQuestData(unique_id, lib:PackQuestData(q, unique_id))
			end
		end
		SelectQuestLogEntry(selectionId)
	end

	update_is_running = false
end

function lib:QUEST_COMPLETE()
	local questname = GetTitleText()

	lib.lastquest.qID = "unknown"
	lib.lastquest.name = questname
	lib.lastquest.chatname = string.format(ERR_QUEST_COMPLETE_S , questname)


	-- search for quest in questlog
	for uid, questdata in pairs(libQ.quests) do
		if questdata.title == questname then
			lib.lastquest.qID = uid
			break
		end
	end

	-- we don't have quest in questlog, search in found table
	if lib.lastquest.qID == "unknown" then
		for k, questdata in pairs(lib.db.global.questfound) do
			if questdata.name == questname then
				lib.lastquest.qID = questdata.id
				break
			end
		end
	end
end

