--[[
	pack questdata into a string to save memory
	--]]

function lib:PackQuestData(datatable, qid)

	local queststring = "Q"..tostring(qid) .. ";"

	for _, k in ipairs(datakeys) do
		--print(k .. " " .. v)
		if datatable[k] then
			if k == "O" and datatable[k] > 0 then
				queststring = queststring .. "O." .. tostring(datatable[k]) .. ";"
				for i=1, datatable[k] do
					--print(i .. " " .. tostring(i) .. " " .. tostring(datatable["o"..i]))
					queststring = queststring .. "o" .. tostring(i) .. "."..  tostring(datatable["o"..i]) .. ";"
				end
			elseif k =="T" then
				if datatable[k] == "G" and datatable.group and datatable.group > 0 then
					queststring = queststring .. k .."." .. tostring(datatable[k]) .. "." .. tostring(datatable.group) .. ";"
				else
					queststring = queststring .. k .."." .. tostring(datatable[k]) .. ";"
				end
			elseif k == "L" or (k == "M" and datatable.L ~= datatable.M) or (k == "H" and datatable.L ~= datatable.H) or k == "Y" or k =="W" or k == "S" then
				queststring = queststring .. k .."." .. tostring(datatable[k]) .. ";"
			end
		end
	end
	return queststring .. "|"
end

function lib:UnpackQuestData(datastring)
	local tmptable = {strsplit(";", datastring)}

	local datatable = {}
	for _, v in ipairs(tmptable) do
		local key, data, group = strsplit(".", v)
		if group then
			datatable["group"] = tonumber(group)
		end

		if key == "L" or key == "M" or key == "O" or key == "H" then
			datatable[key] = tonumber(data)
		else
			datatable[key] = data
		end

	end

	if not datatable.S then
		datatable.S = "E" .. MINOR_VERSION
	end

	-- create level dumy's
	if not datatable.M and datatable.L then
		datatable.M = datatable.L
	end
	if not datatable.H and datatable.L then
		datatable.H = datatable.L
	end

	return datatable
end

function lib:LoadQuestData(qid)
	if not qid or type(qid) ~= 'number' then
		assert(false, 'usage: LibQuestInfo:LoadQuestData(QuestID)')
	end

	if not questcache[qid] or not questcache[qid] then
		-- get Datastring from DB
		local questdata = string.match(QuestDB[ceil(qid/100)], "|Q"..qid..";(.-)|")

		if not questdata then
			return false
		end

		questcache[qid] = lib:UnpackQuestData(questdata)
		questcache[qid].L = questcache[qid].L or -2

		if questcache[qid].L == -1 then
			if questcache[qid].M and UnitLevel("player") < questcache[qid].M then
				questcache[qid].L = questcache[qid].M
			else
				questcache[qid].L = UnitLevel("player")
			end
		end
	end

	return true

end

local priotable = { E = -1, P = 0, S = 1}

function lib:UpdateQuestData(qid, newquestdata)

	if string.match(QuestDB[ceil(qid/100)], newquestdata) then
		-- quest not updated -> exit
		return false
	end

	local oldquestdata = string.match(QuestDB[ceil(qid/100)], "|(Q"..qid..";.-|)")

		-- quest doesn't exist in quest db, insert and exit
	if not oldquestdata then
		QuestDB[ceil(qid/100)] = QuestDB[ceil(qid/100)] .. newquestdata
		lib.callbacks:Fire("QuestDataUpdate", qid, newquestdata)
		return true
	end

	local newquest = lib:UnpackQuestData(newquestdata)
	local oldquest = lib:UnpackQuestData(oldquestdata)

	-- calc priority of questdata, bases on version of lib and source
	oldquest.prio = (priotable[string.match(oldquest.S, "(%a)")] or -1) + (string.match(oldquest.S, "(%d)") or 0)
	newquest.prio = (priotable[string.match(newquest.S, "(%a)")] or -1) + (string.match(newquest.S, "(%d)") or 0)

	local quest, priolevel
	if oldquest.prio > newquest.prio then
		priolevel = oldquest.prio - newquest.prio
		if priolevel == 1 then
			-- data is not to old, do a key based comparsion
			quest = CopyTable(oldquest)
		else
			return false
		end

	else
		priolevel = newquest.prio - oldquest.prio
		if priolevel == 1 or priolevel == 0 then
			-- data be is not to old, do a key based comparsion
			quest = CopyTable(newquest)
		else
			-- new data is newer, insert and exit
			QuestDB[ceil(qid/100)] = QuestDB[ceil(qid/100)] .. newquestdata
			lib.callbacks:Fire("QuestDataUpdate", qid, newquestdata)
			return true
		end
	end


	local changed

	print("Do extended Check for " .. qid)
	for _, key in ipairs({"O","L","M","H","Y","W","T","group"}) do
		if newquest[key] ~= oldquest[key] then
			if not changed then
				changed = {}
			end
			if key == "M" or key == "H" then
				changed.L = true
			else
				changed[key] = true
			end
		end
	end

	-- data not changed, but order is different
	if not changed then
		print("Data for " .. qid .. " not changed (" .. tostring(changed) .. ")")
		return false
	end




	--print(prolevel)
	for k in pairs(changed) do
		-- level
		if k == "L" then
			if not newquest.L or not oldquest.L then
				-- one quest has no leveldata, use leveldata from existning quest
				quest.L = newquest.L or oldquest.L
			else
				-- both quest have a level, set min/max questlevel
				-- this have nothing to do with gained XP Range
				quest.L = -1
				quest.M = min(oldquest.M, newquest.M)
				quest.H = max(oldquest.H, newquest.H)
			end
		elseif priolevel <= 1 then
			quest[k] = oldquest[k] or newquest[k] or nil
		end
	end



	lib.callbacks:Fire("QuestDataUpdate", qid, lib:PackQuestData(quest))

	return true
end

function lib:UpdateQuestZone(qid, newzonekey, oldzonekey)

	local changed

	if not oldzonekey or not (string.match(QuestZones[oldzonekey], "^" .. qid .."|") or string.match(QuestZones[oldzonekey], "|" .. qid .."|")) then
		for k in pairs(QuestZones) do
			if string.match(QuestZones[k], "^" .. qid .."|") or string.match(QuestZones[k], "|" .. qid .."|") then
				if newzonekey ~= k then
					--print("Update Questzone: " .. qid .. " OldZone: " .. k .. " Newzone: " .. newzonekey )
					changed = true;
				end
			end
		end
	end

	if not changed then
		return false
	end
end

function lib:CountChars (haystack, needle)
    haystack = strlower(tostring(haystack));
    needle = strlower(tostring(needle));
    local ret, pos = 0, 0
    for i = 1, strlen(haystack) do
        local s, e = strfind(haystack, needle, pos)
        if e then
            pos = e
            if s == e then
                pos = pos + 1
            end
        end
        if s and e then
            ret = ret + 1;
        else
            break -- If it hasn't found any more, there's no reason to continue
        end
    end
    return ret
end

