function lib:GetQuestLogTitleByID(qid, silent)
	if not qid or type(qid) ~= 'number' then
		if not silent then
			assert(false, "QuestID is not a number")
		end
		return
	end

	lib:LoadQuestData(qid)

	-- questTitle, level, questTag, suggestedGroup, isHeader, isCollapsed, isComplete, isDaily
	return lib:GetQuestName(qid), questcache[qid].L, questcache[qid].T and TagTypes[questcache[qid].T] or nil, questcache[qid].group or 0, nil, nil, nil, questcache[qid].Y, qid
end

LQI = {
	k = {},
	z = {},
}

function lib:GetQuestCategoryKey(zonename)
	local keytype, keyname
	-- zone check
	if ZoneKeys[zonename] then
		return ZoneKeys[zonename]
	end

	-- check non zone key
	if NonZoneKeys[zonename] then
		return NonZoneKeys[zonename]
	end

	if ClassKeys[zonename] then
		return ClassKeys[zonename]
	end

	if not LQI.z[zonename] then
		LQI.z[zonename] = 1
	end


	--print("Unknown Zonename " .. zonename)
	return zonename
end

function lib:GetQuestCategoryName(zonekeyname)
	if ZoneNames[zonekeyname] then
		return ZoneNames[zonekeyname]
	end

	if NonZoneNames[zonekeyname] then
		return NonZoneNames[zonekeyname]
	end

	if ClassNames[zonekeyname] then
		return ClassNames[zonekeyname]
	end


	if string.gsub(zonekeyname, "UNKNOWN_", "") then
		return string.gsub(zonekeyname, "UNKNOWN_", "")
	end

	if not LQI.k[zonekeyname] then
		LQI.k[zonekeyname] = 1
	end
--	print("Unknown Zonekey " .. zonekeyname)
	return zonekeyname
end

function lib:GetQuestName(qid, tmp)
	if not questcache[qid] or not questcache[qid].title then
		if not tmp then
			if not loadqueue[qid] then
				loadqueue[qid] = true
			end
			lib.frame:Show()
			return nil
		end
		return nil
	else
		return questcache[qid].title
	end
end

-- Get a numeric equivalent to a reaction level, from Hated=1 to Exalted=8.
do
	local reactions = {
		[FACTION_STANDING_LABEL1] = 1,
		[FACTION_STANDING_LABEL1_FEMALE] = 1,
		[FACTION_STANDING_LABEL2] = 2,
		[FACTION_STANDING_LABEL2_FEMALE] = 2,
		[FACTION_STANDING_LABEL3] = 3,
		[FACTION_STANDING_LABEL3_FEMALE] = 3,
		[FACTION_STANDING_LABEL4] = 4,
		[FACTION_STANDING_LABEL4_FEMALE] = 4,
		[FACTION_STANDING_LABEL5] = 5,
		[FACTION_STANDING_LABEL5_FEMALE] = 5,
		[FACTION_STANDING_LABEL6] = 6,
		[FACTION_STANDING_LABEL6_FEMALE] = 6,
		[FACTION_STANDING_LABEL7] = 7,
		[FACTION_STANDING_LABEL7_FEMALE] = 7,
		[FACTION_STANDING_LABEL8] = 8,
		[FACTION_STANDING_LABEL8_FEMALE] = 8,
	}
	--------------------------------------------
	-- Arguments:
	-- string - faction standing text
	--
	-- Notes:
	-- Returns a numeric-equivalent for faction standings.
	--
	-- Returns:
	-- * number - number from 1 to 8 or -1 if invalid
	--------------------------------------------
	function lib:GetReactionLevel(leveltext)
		return leveltext and reactions[leveltext] or -1
	end

	function lib:GetReactionName(level)
		for react, index in pairs(reactions) do
			if index == level then
				return react
			end
		end
	end
end
